import sys

def solve(b, d, c, l):
    #print("b = {}, d = {}, c = {}, l = {}".format(b, d, c, l))
    if l%b != 0 or l%d != 0 or l%c != 0:
        return []
    if l == 0:
        return [[0, 0, 0]]
    result = []
    for i in range(l//b + 1):
        for j in range(l//d + 1):
            for k in range(l//c + 1):
                if i*b + j*d + k*c == l:
                    result.append([i, j, k])
    return result

def main():
    b, d, c, l = [int(x) for x in sys.stdin.readline().split()]
    result = solve(b, d, c, l)
    if result == []:
        print("impossible")
    else:
        for r in result:
            print("{} {} {}".format(r[0], r[1], r[2]))

